import '../textsFormate/formate.css';
import './style.css';
import { Link } from "react-router-dom";
import projects from "../../json/projects.json";
import { useState } from "react";

export default function CardOthers() {
    const projects = projects;

    return(
        <div className="publiTitulo">
            <p className="subtitulo">OUTROS PROJETOS</p>
            <div className="card-conteudo">

                {projectData.map((projects) => (
                    <Link to={`/projetos/${projects.id}`}  key={projects.id} className="others-card">
                        <div className='card-img'>
                                <div className="categoria">Aplicativo</div>
                        </div>                    
                    
                    </Link>
                ))}
            </div>
        </div>
        
    )
}

const projectData = [
    {
        id: 1,
        name: "Projeto 1",
        classification: "Dashboard",
        date: "01/01/2021",
        description: "Descrição do Projeto 1"
    },
    {
        id: 2,
        name: "Projeto 2",
        classification: "Figma",
        date: "01/01/2021",
        description: "Descrição do Projeto 2"
    }
];
